import React from 'react';
import { Modal, Button } from 'react-bootstrap';

const EditGuideModal = ({ show, onHide, groupData, onGuideUpdated }) => {
  return (
    <Modal show={show} onHide={onHide}>
      <Modal.Header closeButton>
        <Modal.Title>Editar Guía</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        {/* Implementa el formulario de edición de guía */}
        <p>Formulario de edición de guía (por implementar).</p>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={onHide}>Cerrar</Button>
        <Button variant="primary" onClick={() => onGuideUpdated({name: 'Guía Nuevo'})}>Guardar</Button>
      </Modal.Footer>
    </Modal>
  );
};

export default EditGuideModal;
